package cmd

import (
	"encoding/hex"
	"testing"

	"github.com/stretchr/testify/require"
)

func Test_AA(t *testing.T) {

	const hx = ""
	_, enc := NewRootCmd()

	decoded, err := hex.DecodeString(hx)
	require.NoError(t, err)

	tx, err := enc.TxConfig.TxDecoder()(decoded)

	require.NoError(t, err)

	t.Logf("%#v", tx)
}
